SS DD ASD AED FACT The text in the book is going to read
_*'To make a baby, a woman gives a tiny part, called an egg, and a man gives a tiny part, called sperm. When an egg comes together with sperm, it can turn into a magic seed from which a baby can grow in a woman’s tummy.*_ 

_*We wanted a baby more than anything else in the world, but we didn't have any sperm from a man, and a doctor found that our eggs couldn't make babies.*_

_*Luckily,*_  {{field:fda12f48-8540-482c-8692-691f803932d1}}_* and*_ {{field:f1e3b7b4-de98-4d39-ba0e-5c918df51381}}_* found a woman and man who wanted to help. A woman, who had lots of eggs gave them one.*_ {{field:52bdefb4-f579-4a0e-a9f9-a4bf08ba208a}}
_*And a man gave them some sperm.*_ {{field:beb5cc01-880a-4e4d-964b-c2530dfc4f13}}

_*With these special gifts, a doctor could make a magic seed to put in*_  {{field:fda12f48-8540-482c-8692-691f803932d1}}_*'s tummy, hoping that it would grow into a baby.'*_
